import { IoPrint } from 'react-icons/io5';
import './IconPrint.css';
import ReactToPrint from 'react-to-print';

// Return Print Component 
export default function ReturnIconPrint() {
 return (
  <div className='wrp-print-actif'>

   <ReactToPrint
    trigger={() => {
     return (<a href='#'>print</a>);
    }}

   />
  </div>
 );
};
